	[10019] = {Material_Name= "铕", Material_rare=1, rate=200.0, Scan_Time=10800, Material_Discribe= "铕为铁灰色金属，广泛用于制造反应堆控制材料和中子防护材料，也是很好的激光材料。是最稀有的稀土元素，主要从独居石和氟碳铈矿中制取。克为由斯卫星群上有少量分布。", Transport_Time=10, Image= "Texture2D'/Game/Texture/Warehouse/Material/Athena_10019_01.Athena_10019_01'", Image2= "Texture2D'/Game/Texture/Warehouse/Material/Athena_10019_02.Athena_10019_02'", },
	[10020] = {Material_Name= "钙", Material_rare=1, rate=80.0, Scan_Time=10800, Material_Discribe= "主要用作金属的金属的脱氧剂，油类脱水剂，冶金还原剂。可从地球获取。", Transport_Time=10, Image= "Texture2D'/Game/Texture/Warehouse/Material/Athena_10020_01.Athena_10020_01'", Image2= "Texture2D'/Game/Texture/Warehouse/Material/Athena_10020_02.Athena_10020_02'", },
	[10021] = {Material_Name= "铝", Material_rare=1, rate=100.0, Scan_Time=10800, Material_Discribe= "在地球地壳中含量位居第三位，含量最丰富的金属元素。银白色轻金属。有良好延展性，及导热，导电性能。常用于制造爆炸混合物，以及合金材料。", Transport_Time=10, Image= "Texture2D'/Game/Texture/Warehouse/Material/Athena_10021_01.Athena_10021_01'", Image2= "Texture2D'/Game/Texture/Warehouse/Material/Athena_10021_02.Athena_10021_02'", },
	[10022] = {Material_Name= "金", Material_rare=1, rate=200.0, Scan_Time=10800, Material_Discribe= "密度高、柔软、光亮、抗腐蚀，是延展性最好的金属之一。因其良好的导电性和导热性，作为导体触媒应用于护甲中。产地主要是巴比伦。", Transport_Time=10, Image= "Texture2D'/Game/Texture/Warehouse/Material/Athena_10022_01.Athena_10022_01'", Image2= "Texture2D'/Game/Texture/Warehouse/Material/Athena_10022_02.Athena_10022_02'", },
	[10023] = {Material_Name= "锰", Material_rare=1, rate=80.0, Scan_Time=10800, Material_Discribe= "灰白色、硬脆、有光泽的过渡金属。作为合金的添加料，以提高钢的强度、硬度、弹性极限、耐磨性和耐腐蚀性等。可从金星获取。", Transport_Time=10, Image= "Texture2D'/Game/Texture/Warehouse/Material/Athena_10023_01.Athena_10023_01'", Image2= "Texture2D'/Game/Texture/Warehouse/Material/Athena_10023_02.Athena_10023_02'", },
